import Text from '../../atoms/Text'
import Img  from '../../atoms/Image'

import imageProfiule from '../../images/profile.jpg'

const Profile = () => {
    const home = 'Home';
    const profile = 'profile';
    const account = 'account';
    const settings = 'settings';
    const typeInfo = 'p';
    
    const altInfo = 'profileImage'
    return(
        <div className="profile-wrap">
            <div className='home'>{home}  </div>
            <div className='profile-container'>
                <div className='profile-image-info'>
                    
                    <Img sourse = {imageProfiule} alter = {altInfo}/>
                   
                    <Text textInput={profile} type ={typeInfo}/>
                    
            
                </div>
                <div className='profile-info'>
                    <ul>
                        <li><Text textInput={account} /></li>
                        <li><Text textInput={settings} /></li>
                    </ul>
                </div>
            </div>
        </div>


    )
}
export default Profile
